Калькулятор Ocopywritinge создан для упрощения просчета точной стоимости услуг в сфере копирайтингаПриложение «Ocopywritinge»  – это онлайн-калькулятор для оценки стоимости услуг копирайтинга/рерайтинга. Был создан посредствам таких инструментов как: PHP, JS для исполнения кода в браузере и, соответствующего IDE. Калькулятор имеет 6 основных категорий (информационных продуктов). На панели управления они называются «Типами работ».  Это услуги, которые можно заказать по теме копирайтинга. В списке: 

•	Копирайтинг (с вашим ТЗ);
•	Аналитические, художественные статьи (выделены в одну категорию);
•	SEO/LSI копирайтинг (с нашим ТЗ);
•	Шаблон для генерации текстов;
•	Тексты для email-рассылки;
•	Продающий текст (копирайтинг).

Смысл калькулятора в том, что он позволяет узнавать точную стоимость работы, с учетом большинства переменных. По каждой из основных категорий есть от 5 до 16 дополнительных переменных. У разных клиентов, заказывающих услуги по написанию текстового контента (копирайтинга), бывают крайне отличающиеся задачи. Но цены на специализированных сайтах, как правило фиксированные. В случае с калькулятором, стоимость выполненной работы определяется не необоснованной фиксированной ставкой, а реальной оценкой сложности задачи.

В этом случае, чем меньше переменных будет задействовано в описании задачи, тем дешевле будет стоить работа. В итоге остаются довольны и исполнители, и заказчик, который существенно экономит на заказе услуг и видит реальную рыночную стоимость за конкретные услуги. 

