Задача игрока - привести все свои фишки в «дом» и снять их с доски раньше, чем это сделает второй игрок.

В начале игры все 15 фишек располагаются на 24 позиции – в «голове». С «головы» можно снимать только одну фишку за один ход. Это правило имеет исключение для первого хода. Если у игрока, который ходит первым, выпадает дубль: 6-6, 4-4 или 3-3, то он имеет право снять с головы 2 фишки. Соответственно, второй игрок своим первым ходом на дубль тоже может снять две фишки, если он не сможет пойти своей одной фишкой полный ход.

В процессе игры фишки двигаются против часовой стрелки друг за другом, а не навстречу.

Когда игрок бросает кости, то он обязан в соответствии с выпавшими очками передвинуть свои фишки, руководствуясь следующими правилами:

- если на пункте стоит фишка противника, то на этот пункт ставить свою фишку нельзя;

- ходить надо строго на то число очков, которое выпало на кости;

- двигать можно любое количество фишек;

- нельзя суммировать очки на двух фишках – надо перемещать фишку сначала на число очков, выпавшее на одной кости, а потом на число очков, выпавшее на второй;

- на одном пункте может стоять любое количество фишек;

- если на пункте стоит фишка противника, то на этот пункт ставить свою фишку нельзя;

- игрок обязан, даже в ущерб себе, использовать все выпавшие очки. Если есть два хода, один из которых использует одну фишку, а другой – две, игрок обязан сделать ход, использующий обе кости (правилополного хода);

- если у игрока нет допустимых ходов, он пропускает ход;

- выстраивая последовательность фишек, игрок не имеет права делать непроходимый заслон перед фишками противника, если впереди этого заслона нет хотя бы одной фишки противника.

